package main

import "fmt"

func main() {
	input := ""

	groupLength := 14

	for i := 0; i < len(input)-groupLength; i++ {
		candidate := input[i : i+groupLength]
		fmt.Printf("%s\n", candidate)
		set := [26]bool{}
		for j := 0; j < len(candidate); j++ {
			set[candidate[j]-'a'] = true
		}
		count := 0
		for j := 0; j < 26; j++ {
			if set[j] == true {
				count += 1
			}
		}

		if count == groupLength {
			fmt.Printf("Found 4 at %d\n", i+groupLength)
			break
		}

	}

}
